    {name:"HTML Dev course", price: 147},
    {name:"CSS Dev course", price: 694},
    {name:"Javascript Dev course", price: 476}]
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-log" alt="logo"/>
    <h2>This is a CourseSale</h2>
        </div>
        <Coursesale />
      </div>
    )
  }
}
